            yield return "    for (int k = 0; k < Length; k += 1)";
            yield return "    {";
            foreach (var _Line in Combine(Combine(Combine(Combine(Combine(Begin(), "        "), KeyTypeString), " Key = "), GetEscapedIdentifier(Combine(Combine(Begin(), KeyTypeFriendlyName), "FromBinary"))), "(s);"))
            {
