            }
            yield return "{";
            yield return "    int Length = l.size();";
            yield return "    IntToBinary(s, Length);";
            foreach (var _Line in Combine(Combine(Combine(Begin(), "    for ("), KeyTypeString), " Key : l.keySet())"))
            {
                yield return _Line;
            }
            yield return "    {";
            foreach (var _Line in Combine(Combine(Combine(Begin(), "        "), GetEscapedIdentifier(Combine(Combine(Begin(), KeyTypeFriendlyName), "ToBinary"))), "(s, Key);"))
